import Link from 'next/link';
import styles from './Example.module.css'

const Footer = () => (
    <Footer>
        <Link href='/'>
            <p className={styles.footerContainer}>NYC @copy, 2020, All Rights Reserved</p>
        </Link>
    </Footer>


)

export default Footer;
